const geicoMeta = {
  desc: 'GEICO iOS app (10M monthly users)',
  img: 'https://is1-ssl.mzstatic.com/image/thumb/Purple211/v4/e6/5c/9a/e65c9a80-1eaa-606e-ca79-9a0921d0921f/AppIcon-1x_U007emarketing-0-7-0-85-220-0.png/1200x630wa.png',
  imgSq: {width: 50, height: 50},
  link: 'https://apps.apple.com/us/app/geico-mobile-car-insurance/id331763096',
  prefix: 'Contributed to the '
}

const hiyaMeta = {
  desc: 'Hiya iOS app (250K monthly users)',
  img: 'https://is1-ssl.mzstatic.com/image/thumb/Purple221/v4/40/68/8f/40688f33-758d-52d3-8285-03f632a7cd70/AppIcon-0-0-1x_U007ephone-0-1-0-85-220.png/1200x600wa.png',
  imgSq: {width: 50, height: 50},
  link: 'https://apps.apple.com/us/app/hiya-spam-blocker-caller-id/id986999874',
  prefix: 'Contributed to the '
}

function AppContributions() {
  const appEntryStyle = {
    display: 'flex', 
    alignItems: 'center',
    paddingTop: '5px',
    paddingBottom: '5px',
    width: '50vw'
  }
  return (<div style={{display: 'grid', justifyContent: 'center'}}>
    {[geicoMeta, hiyaMeta].map((meta) => <div style={appEntryStyle}>
      <pre style={{color: 'white', fontFamily: 'system-ui, -apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell, Open Sans, Helvetica Neue, sans-serif'}}>{meta.prefix}</pre>
      <a className='app-store' href={meta.link}>{meta.desc}</a>
      <img src={meta.img} style={{clipShape: 'circle', borderRadius:'20px', width: meta.imgSq.width+50, height: meta.imgSq.height, paddingLeft: '10px'}}/>
    </div>)}
  </div>)
}

function Portfolio() {
  return (
    <div>
      <AppContributions/>
    </div>
  )
}

export { Portfolio }
